import './Home.css';

function Home(props) {
    return (
        <div>
            
            <div className="banner">
                <div className="container">
                    <h1 className="home_title">CODE WITH TIENKIM</h1>
                    <p></p>
                </div>
            </div>

        </div>
    );
}

export default Home;
